import { TextField, FormControl, FormLabel, RadioGroup, FormControlLabel, Radio } from "@material-ui/core";
import { makeStyles } from "@material-ui/styles";
import { Paper } from "@material-ui/core";

const useStyles = makeStyles((theme) => ({
    root: {
      '& > *': {
        margin: '20px',
        width: '25ch',
      },
    },
    background: {
        backgroundColor: '#FDFDFD'
    }
  }));

const Filter = () => {

    const classes = useStyles();

    const [value, setValue] = React.useState('female');

    const handleChange = (event) => {
        setValue(event.target.value);
    };
    return ( 
        <Paper className={classes.background} variant="outlined" elevation={0}>
            <h2>Filter Results</h2>
            <form className={classes.root} noValidate autoComplete="off">
                <TextField id="outlined-basic" label="Title" variant="outlined" />
                <TextField id="outlined-basic" label="Author" variant="outlined" />
            </form>
            <FormControl component="fieldset">
                <FormLabel component="legend">Gender</FormLabel>
                <RadioGroup aria-label="gender" name="gender1" value={value} onChange={handleChange}>
                    <FormControlLabel value="female" control={<Radio />} label="Female" />
                    <FormControlLabel value="male" control={<Radio />} label="Male" />
                    <FormControlLabel value="other" control={<Radio />} label="Other" />
                    <FormControlLabel value="disabled" disabled control={<Radio />} label="(Disabled option)" />
                </RadioGroup>
            </FormControl>
        </Paper>
     );
}

export default Filter;
